import Link from 'next/link';
import { getSiteTitle } from './site';
import { getDisciplineURL } from './iracing/data/series-util';

export default function Page() {
  const pageBG =
    'url(/home/speckled.png), linear-gradient(180deg, #88888840 0%, #00000040 100%), #DEECF2';
  const cardBG =
    'linear-gradient(180deg, #FFFFFF40 0%, #AAAAAA40 100%), #FFFFFFCC';

  return (
    <main
      className="flex h-full flex-col items-center justify-center gap-16 p-6"
      style={{
        background: pageBG,
        backgroundBlendMode: 'multiply, normal, normal',
        backgroundSize: '50%',
      }}
    >
      <div className="shadow-homeShadow rounded-sm border-2 bg-[url(/home/track3x-min.jpg)] bg-cover p-16">
        <div
          className="rounded-sm p-16"
          style={{
            background: cardBG,
            backgroundBlendMode: 'screen, screen',
          }}
        >
          <BoxBoxLandingLogo />
        </div>
      </div>
      <Link
        href={getDisciplineURL('Road')}
        className="text-blue800 hover:underline"
      >
        {getSiteTitle()}
      </Link>
    </main>
  );
}

